import React from 'react';
import { Image, StyleSheet, Text, TouchableOpacity, View,TextInput  } from 'react-native';
import logo from './assets/logo.png'; 

export default function App() {
  return (
    <View style={styles.container}>
      <Image source={logo} style={styles.logo} />
	  <TextInput style = {styles.input}
        underlineColorAndroid = "transparent"
        placeholder = "Email"
        placeholderTextColor = "#9a73ef"
        autoCapitalize = "none"/>

      <TextInput style = {styles.input}
        underlineColorAndroid = "transparent"
        placeholder = "Password"
        placeholderTextColor = "#9a73ef"
        autoCapitalize = "none"/>

	  <TextInput style = {styles.input}
        underlineColorAndroid = "transparent"
        placeholder = "Name"
        placeholderTextColor = "#9a73ef"
        autoCapitalize = "none"/>

	  <TextInput style = {styles.input}
        underlineColorAndroid = "transparent"
        placeholder = "Surname"
        placeholderTextColor = "#9a73ef"
        autoCapitalize = "none"/>

	  <TextInput style = {styles.input}
        underlineColorAndroid = "transparent"
        placeholder = "Phone"
        placeholderTextColor = "#9a73ef"
        autoCapitalize = "none"/>

	  <TextInput style = {styles.input}
        underlineColorAndroid = "transparent"
        placeholder = "T"
        placeholderTextColor = "#9a73ef"
        autoCapitalize = "none"/>


      <TouchableOpacity onPress={() => alert('Hello, world!')} style={styles.button}>
        <Text style={styles.buttonText}>Register</Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
	padding:10
  },
  logo: {
	flex:3,
	justifyContent: 'center',
    alignItems: 'center',
	width:'100%',
    height: '100%',
    margin: 20,
  },
  instructions: {
    color: '#888',
    fontSize: 18,
    marginHorizontal: 15,
    marginBottom: 10,
  },
  button: {
	flex:1,
	alignItems: 'center',
    backgroundColor: "#9400D3",
    padding: 20,
    borderRadius: 5,
  },
  buttonText: {
    fontSize: 20,
    color: '#fff',
  }, 
   input: {
	  flex:1,
	  margin:10,
      height: 40,
      borderColor: '#7a42f4',
      borderWidth: 1
   },

});
